-- ----------------------------
-- Procedure structure for insertEngineer
-- ----------------------------
DROP PROCEDURE IF EXISTS `insertEngineer`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `insertEngineer`( IN engineerName varchar(256))
BEGIN
    DECLARE x INT DEFAULT 0;
    DECLARE y INT DEFAULT 0;
    CREATE TABLE IF NOT EXISTS `engineer` (`ID` int(11) NOT NULL auto_increment,`NAME` varchar(256) NOT NULL,PRIMARY KEY (`ID`)) AUTO_INCREMENT=1 ;    
	SET y = 1; 
 
    IF NOT engineerName IS NULL
    THEN
           SELECT LENGTH(engineerName) - LENGTH(REPLACE(engineerName, ',', '')) INTO @noOfCommas;
     
           IF  @noOfCommas = 0
          THEN
          ELSE
                SET x = @noOfCommas + 1;
                WHILE y  <=  x DO
                   SELECT split_string(engineerName, ',', y) INTO @engName;
                   SET  y = y + 1;
                END WHILE;
        END IF;
    END IF;
END
;;
DELIMITER ;

