DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_useradd`( IN user_name varchar(256))
BEGIN
DECLARE max_id int;
DECLARE has int DEFAULT 0;
SELECT max(id) FROM tb_user INTO max_id;
SELECT 1 into has FROM tb_user  WHERE name = user_name;
  IF has =0 THEN
    COMMIT;
  END IF;
END
;;
