-- ----------------------------
-- Function structure for getAge
-- ----------------------------
DROP FUNCTION IF EXISTS `getAge`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getAge`(HM varchar(50)) RETURNS varchar(50) CHARSET utf8
BEGIN
DECLARE RE_AGE VARCHAR(20);
DECLARE V_HM VARCHAR(20);
DECLARE C_PK VARCHAR(20);


IF LENGTH(HM)=15
THEN

SET V_HM=getIdCard(HM);
	 
ELSE 
SET V_HM=HM ;

END IF;

 
IF  LENGTH(V_HM)=18 
THEN 
SET RE_AGE=DATE_FORMAT(curdate(),'%Y')-substr(V_HM,7,4) ;
	ELSE
	SET RE_AGE=0;
	END IF ;
  
IF RE_AGE >=100 OR RE_AGE<0
THEN 
SET RE_AGE=0;
END IF;

RETURN RE_AGE;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getGender
-- ----------------------------
DROP FUNCTION IF EXISTS `getGender`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getGender`(HM varchar(50)) RETURNS varchar(50) CHARSET utf8
BEGIN
DECLARE RE_SEX VARCHAR(4);
DECLARE V_SEX VARCHAR(4);
 


IF LENGTH(HM)=18
THEN
	SET V_SEX= SUBSTRING(HM,17,1) ;
	 IF V_SEX%2=0 
	 THEN 
	 SET RE_SEX='0' ;
	 else 
	 SET RE_SEX='1';
	 end if; 
ELSEIF
  LENGTH(HM)=15
 THEN

  SET V_SEX= SUBSTRING(HM,15,1) ;
	 IF V_SEX%2=0 
	 THEN 
	 SET RE_SEX='0';
	 else 
	 SET RE_SEX='1';
	 end if;


ELSE
 SET RE_SEX='3';

END IF;


RETURN RE_SEX;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getIdCard
-- ----------------------------
DROP FUNCTION IF EXISTS `getIdCard`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getIdCard`(HM varchar(50)) RETURNS varchar(50) CHARSET utf8
BEGIN
	 
DECLARE  re_zjhm varchar(20)  DEFAULT '' ;
DECLARE  in_length varchar(20)  DEFAULT ''  ;

set in_length=LENGTH(TRIM(HM));


if in_length =15 then
set re_zjhm=CONCAT (SUBSTRING(HM,1,6),
(CASE WHEN SUBSTRING(HM,7,2)>SUBSTRING(YEAR(CURDATE()),3,2) -- 这里假设不会有百岁的情况
THEN '19'
ELSE '20'
END)
,SUBSTRING(HM,7,9)
,(
CASE  ((SUBSTRING(HM,1,1)*7+
SUBSTRING(HM,2,1)*9+
SUBSTRING(HM,3,1)*10+
SUBSTRING(HM,4,1)*5+
SUBSTRING(HM,5,1)*8+
SUBSTRING(HM,6,1)*4+
(CASE WHEN SUBSTRING(HM,7,2)>SUBSTRING(YEAR(CURDATE()),3,2)
THEN
1*2+
9*1
ELSE 
2*2+
0*1
END)+
SUBSTRING(HM,7,1)*6+
SUBSTRING(HM,8,1)*3+
SUBSTRING(HM,9,1)*7+
SUBSTRING(HM,10,1)*9+
SUBSTRING(HM,11,1)*10+
SUBSTRING(HM,12,1)*5+
SUBSTRING(HM,13,1)*8+
SUBSTRING(HM,14,1)*4+
SUBSTRING(HM,15,1)*2  )%11)
WHEN 0 THEN '1'
WHEN 1 THEN '0'
WHEN 2 THEN 'X'
WHEN 3 THEN '9'
WHEN 4 THEN '8'
WHEN 5 THEN '7'
WHEN 6 THEN '6'
WHEN 7 THEN '5'
WHEN 8 THEN '4'
WHEN 9 THEN '3'
WHEN 10 THEN '2' 
ELSE 'FALSE' END ) );

else

set re_zjhm=hm;
end if;

	RETURN re_zjhm;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for split_string
-- ----------------------------
DROP FUNCTION IF EXISTS `split_string`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `split_string`(
stringToSplit VARCHAR(256),
sign VARCHAR(12),
position INT) RETURNS varchar(256) CHARSET utf8
BEGIN
        RETURN REPLACE(SUBSTRING(SUBSTRING_INDEX(stringToSplit, sign, position),LENGTH(SUBSTRING_INDEX(stringToSplit, sign, position -1)) + 1), sign, '');
END
;;
DELIMITER ;
